// src/components/Button/Button.tsx
import React from 'react';
import './Button.scss';

interface ButtonProps {
  label: string;
  variant?: 'default' | 'icon';
  disabled?: boolean;
}

const Button: React.FC<ButtonProps> = ({ label, variant = 'default', disabled = false }) => {
  return (
    <button className={`button ${variant} ${disabled ? 'disabled' : ''}`} disabled={disabled}>
      {label}
    </button>
  );
};

export default Button;
